(1, 'Footer Links', 'footer_links', '<ul class="col-xs-6 col-md-4 col-sm-4">\r\n<li><a href="{{store direct_url="about-magento-demo-store"}}">CGV </a></li>\r\n<li><a href="{{store direct_url="customer-service"}}">SAV</a></li>\r\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Livraison</a></li>\r\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Paiement sécurisé</a></li>\r\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Confidentialité</a></li>\r\n</ul>\r\n<ul class="col-xs-6 col-md-4 col-sm-4 footer-center">\r\n<li><a href="{{store direct_url="about-magento-demo-store"}}">Press</a></li>\r\n<li><a href="{{store direct_url="customer-service"}}">About</a></li>\r\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Careers</a></li>\r\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Contact</a></li>\r\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Help</a></li>\r\n</ul>\r\n<ul class="col-xs-6 col-md-4 col-sm-4">\r\n<li><a href="{{store direct_url="about-magento-demo-store"}}">Language</a></li>\r\n{{block type="core/template" template="newsletter/subscribe.phtml"}}\r\n</ul>', '2015-03-19 19:49:32', '2015-03-25 07:10:21', 1),
(2, 'Footer Links Company', 'footer_links_company', '<div class="col-xs-12 col-md-4 col-sm-4 right_footer">\r\n<ul>\r\n<li>{{block type="page/switch" template="page/switch/languages.phtml"}}</li>\r\n{{block type="core/template" template="newsletter/subscribe.phtml"}}</ul>\r\n</div>\r\n<div class="col-xs-6 col-md-4 col-sm-4">\r\n<ul>\r\n<li><a href="{{store direct_url="about-magento-demo-store"}}">CGV </a></li>\r\n<li><a href="{{store direct_url="customer-service"}}">SAV</a></li>\r\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Livraison</a></li>\r\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Paiement s&eacute;curis&eacute;</a></li>\r\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Confidentialit&eacute;</a></li>\r\n</ul>\r\n</div>\r\n<div class="col-xs-6 col-md-4 col-sm-4 footer-center">\r\n<ul>\r\n<li><a href="{{store direct_url="about-magento-demo-store"}}">Press</a></li>\r\n<li><a href="{{store direct_url="customer-service"}}">About</a></li>\r\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Careers</a></li>\r\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Contact</a></li>\r\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Help</a></li>\r\n</ul>\r\n</div>\r\n<div class="clearfix">&nbsp;</div>', '2015-03-19 19:49:35', '2015-03-27 11:47:08', 1),
(3, 'Cookie restriction notice', 'cookie_restriction_notice_block', '<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button below.</p>', '2015-03-19 19:49:37', '2015-03-19 19:49:37', 1),
(4, 'back product', 'back_product', '<div class="back_product"><img class="img-responsive" alt="" src="{{media url="wysiwyg/opening-party.jpg"}}" />\r\n<div class="link1">\r\n<span><a href="#"><span class="lin">Opening Party</span><span class="blank">&nbsp;</span></a></span></div>\r\n<div class="link2"><span><a href="#"><span class="lin">Watch trailer</span><span class="blank">&nbsp;</span></a></span></div>\r\n</div>', '2015-03-24 08:53:56', '2015-03-24 09:27:19', 1),
(5, 'cgv', 'cgv', '<div class="title">Conditions G&eacute;n&eacute;rales de Vente</div>\r\n<div class="txt_cgv">\r\n<p>1. Le paiement de vos produits devra &ecirc;tre effectu&eacute; par carte bancaire, American Express ou Paypal, suivant les indications figurant sur la page concernant le paiement.<br /><br />2. Le paiement complet du prix, y compris les frais d&rsquo;exp&eacute;dition et tous frais suppl&eacute;mentaires pour des services que vous aurez command&eacute;s, sera d&eacute;bit&eacute; de votre carte bancaire ou de votre compte Paypal, apr&egrave;s v&eacute;rification de la disponibilit&eacute; des produits command&eacute;s, au moment ou peu de temps avant l&rsquo;exp&eacute;dition des produits chez vous. Nous ne vous livrerons les produits que si votre paiement est effectif.<br /><br />3. Vous confirmez que la carte bancaire utilis&eacute;e est la v&ocirc;tre. Tous les d&eacute;tenteurs de cartes bancaires sont soumis &agrave; des contr&ocirc;les de validation et &agrave; l&rsquo;autorisation par l&rsquo;&eacute;metteur de la carte. Si l&rsquo;&eacute;metteur de votre carte refuse d&rsquo;autoriser le paiement, nous serons en droit de refuser de proc&eacute;der &agrave; la livraison de votre commande et ne serons pas responsables de tout retard ou de toute absence de livraison. Nous vous enverrons un courriel pour vous informer des raisons du refus.<br /><br />4. Vos donn&eacute;es bancaires seront trait&eacute;es de mani&egrave;re s&eacute;curis&eacute;e, conform&eacute;ment &agrave; notre D&eacute;claration de Protection de la Vie Priv&eacute;e, que vous pouvez consulter en cliquant [ici].<br /><br />5. Les coordonn&eacute;es de la carte de cr&eacute;dit utilis&eacute;e pour le paiement de votre commandes sont susceptibles d&rsquo;&ecirc;tre sauvegard&eacute;es de mani&egrave;re s&eacute;curis&eacute;e. Le cryptogramme visuel au dos de la carte est syst&eacute;matiquement requis pour pouvoir utiliser la carte lors d&rsquo;un achat ult&eacute;rieur et vous conservez la possibilit&eacute; de supprimer la carte de cr&eacute;dit sauvegard&eacute;e de la liste propos&eacute;e lors de l&rsquo;&eacute;tape de paiement.</p>\r\n</div>', '2015-03-25 12:24:37', '2015-03-25 12:59:46', 1),
(6, 'bloc catégories message', 'bloc-category', 'Welcome Offer: Get 20% On Your First Card with the code: FI2015!', '2015-04-05 17:17:08', '2015-04-05 17:17:08', 1),
(7, 'produits home', 'prod_home', '<div class="col-xs-6 col-md-6 col-sm-6 perfecto perfecto2 perfecto3"><img class="img-responsive" alt="" src="{{media url="wysiwyg/2.jpg"}}" />\r\n<div class="link1"><span><span class="lin">Jacket</span><span class="blank">&nbsp;</span></span></div>\r\n<div class="link2"><span><span class="lin"><a href="#">More details</a></span><span class="blank">&nbsp;</span></span></div>\r\n</div>\r\n<div class="col-xs-6 col-md-6 col-sm-6 perfecto perfecto2 perfecto3"><img class="img-responsive" alt="" src="{{media url="wysiwyg/3.jpg"}}" />\r\n<div class="link1"><span><span class="lin">Skirt</span><span class="blank">&nbsp;</span></span></div>\r\n<div class="link2"><span><span class="lin"><a href="#">More details</a></span><span class="blank">&nbsp;</span></span></div>\r\n</div>', '2015-04-06 14:15:37', '2015-04-06 14:15:37', 1),
