roduct-image" href="#"><img class="img-responsive" alt="" src="{{media url=wysiwyg/magazines/mag13.jpg}}" />\r\n<div class="link1"><span><span class="lin">Summer essential</span><span class="blank">&nbsp;</span></span></div>\r\n<div class="link2"><span><span class="lin">Caroline de Maigret</span><span class="blank">&nbsp;</span></span></div></a>\r\n</div>\r\n<div class="clearfix visible-xs">&nbsp;</div>\r\n<div class="clearfix visible-sm">&nbsp;</div>\r\n<div class="col-xs-6 col-sm-4 col-sm-push-2 col-md-3 col-md-push-0 mag2"><a class="product-image" href="#"><img class="img-responsive" alt="" src="{{media url=wysiwyg/magazines/mag14.jpg}}" />\r\n<div class="link1"><span><span class="lin">Summer essential</span><span class="blank">&nbsp;</span></span></div>\r\n<div class="link2"><span><span class="lin">Caroline de Maigret</span><span class="blank">&nbsp;</span></span></div></a>\r\n</div>\r\n<div class="col-xs-6 col-sm-4 col-sm-push-2 col-md-3 col-md-push-0 mag2"><a class="product-image" href="#"><img class="img-responsive" alt="" src="{{media url=wysiwyg/magazines/mag15.jpg}}" />\r\n<div class="link1"><span><span class="lin">Summer essential</span><span class="blank">&nbsp;</span></span></div>\r\n<div class="link2"><span><span class="lin">Caroline de Maigret</span><span class="blank">&nbsp;</span></span></div></a>\r\n</div>\r\n</div>\r\n</div>', '2015-04-29 20:06:00', '2015-05-06 19:33:10', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(11, 'Opening party SS2015', 'one_column', NULL, NULL, 'article1', NULL, '<div class="magazines-articles">\r\n<div class="content">\r\n<div class="prev"><a href="#">&nbsp;</a></div>\r\n<div class="article">\r\n<div class="sub-category">&eacute;v&egrave;nement</div>\r\n<h1 class="title">Opening party SS2015</h1>\r\n<p class="responsive-title">In the countdown to New York fashion week, we asked our favorite stylists and fashion travelers to share their fashion week packing list. Those essential items in their suitcases that bring comfort and glamor during four weeks of fashion shows.</p>\r\n</div>\r\n<div class="next"><a href="#">&nbsp;</a></div>\r\n</div>\r\n<a class="product-image" href="#"> <img class="img-responsive" alt="" src="{{media url=wysiwyg/magazines/articles/opening-party-1.jpg}}" /></a> <br /> <a class="product-image" href="#"> <img class="img-responsive" alt="" src="{{media url=wysiwyg/magazines/articles/opening-party-2.jpg}}" /></a> <br /> <a class="product-image" href="#"> <img class="img-responsive" alt="" src="{{media url=wysiwyg/magazines/articles/opening-party-3.jpg}}" /></a> <br /> <a class="product-image" href="#"> <img class="img-responsive" alt="" src="{{media url=wysiwyg/magazines/articles/opening-party-4.jpg}}" /></a></div>', '2015-05-01 19:08:16', '2015-05-11 20:42:05', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(12, 'Josephine de la Baume,', 'one_column', NULL, NULL, 'article2', NULL, '<div class="magazines-articles">\r\n<div class="content">\r\n<div class="prev"><a href="#">&nbsp;</a></div>\r\n<div class="article">\r\n<div class="row">\r\n<div class="col-xs-12 col-sm-6 col-spacing">\r\n<div class="sub-category">Smoking with...</div>\r\n<h1 class="title responsive-title">Josephine de la Baume,<br />The quintesential 21st century parisian</h1>\r\n<p>Parisian it girl (and much more), Jeanne Damas popped by F&ecirc;te Imp&eacute;riale for a fashion series to die for. Feature. And the best bit? As Jeanne Damas will tell you, the secret to becoming an it girl is to never, ever, think about it. Since the age of 14, the 22-year old has been documenting her social life online, her new famous and not-so-famous friends and her love of the perfect look &ndash; starting out, like all her high-school friends &ndash; on Skyblog. She met all the right people at trendy parties and founded herself at the very epicentre of a fashion buzz just a couple of seasons ago &ndash; one that she drew around her with her cool gaze and big dark eyes.</p>\r\n<p>The quintesential 21st century parisienne <br /> <small>Jeanne is the quintessential 21st century Parisian. You know, that cool elegance, the knack of making the simple look ultra-sophisticated and the cheeky pout. With a touch of Jane Birkin thrown in&ndash; she loves Jane Birkin &ndash; to give off an air of the unconventional, somewhere between vulnerability and determination. She embodies that disarming spontaneity of the new generation of young women who are totally at ease with their image and see fun as a source of self-discovery. And because Jeanne Damas has mastered the art of predicting the return of high-waist denims or finding that earth-shaking accessory, her blog photos, still shot with film, are a must-go for all trendsetters. Hip stylists offer her chic photoshoots and fashion labels invite her to design capsule collections. Jeanne Damas enjoys the attention and goes where she pleases. To Leon and Harper, for example, where she&rsquo;s beginning 2015 with her own role in a superb Quentin de Briey fashion series: &ldquo;I can identify with the Leon and Harper style&rdquo; she comments.</small></p>\r\n</div>\r\n<div class="col-xs-12 col-sm-6"><a class="product-image" href="#"> <img class="img-responsive" alt="" src="{{media url=wysiwyg/magazines/articles/josephine-1.jpg}}" /></a>\r\n<div class="follow">\r\n<ul class="soc">\r\n<li><a class="soc-facebook" href="#"><span class="vide">aa</span></a></li>\r\n<li><a class="soc-twitter" href="#"><span class="vide">aa</span></a></li>\r\n<li><a class="soc-pinterest" href="#"><span class="vide">aa</span></a></li>\r\n<li><a class="soc-instagram" href="#"><span class="vide">aa</span></a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="row">\r\n<div class="col-xs-12 col-sm-6 col-spacing">\r\n<div class="quote">&rdquo;That cool elegance,<br />the knack of making the simple look ultra-sophis- ticated and chic.&rdquo;</div>\r\n<br />\r\n<p>&ldquo;Oderly chaos and escape plan&rdquo;<br /> <small>JSo what is Jeanne Damas&rsquo; philosophy of life? To find the answer, look no further than Woody Allen: &ldquo;What I like about his world is that it&rsquo;s an orderly chaos&rdquo;: a wonderful expression that gives us an insight into the secret world of a new generation of young women in general, and Jeanne Damas in particular. The young woman of today who talks about her &ldquo;therapists&rdquo; (&ldquo;It&rsquo;s perfectly normal to change therapists when you&rsquo;re young, isn&rsquo;t it?&rdquo;). Who says: &ldquo;I&rsquo;ve still got much to prove. The person I am today has come about very much by chance&rdquo;. But corrects herself immediately with &ldquo;actually, it&rsquo;s my image and I wanted this image&rdquo;. And concludes with a general statement about her generation, &ldquo;we do show a lot of ourselves but we keep a distance: everybody thinks they know us but nobody knows who we really are.&rdquo;</small></p>\r\n<br />\r\n<p>&ldquo;Taking life as it comes&rdquo;<br /> <small>Let&rsquo;s see. Because when I ask her what her favourite theatrical role has been, she immediately replies: Ibsen&rsquo;s A Doll&rsquo;s House. &ldquo;It&rsquo;s the story about a housewife called Nina,&rdquo; she summarises, &ldquo;who realises that she&rsquo;s being treated like a doll and toughens up to gain her independence&rdquo; The same theme of toughening up and emancipation in everyday life arises when the conversation moves on to the cinema and she expresses a preference for Abdelatif Kechiche and C&eacute;line Sciamma, and for &ldquo;dark and twisted&rdquo; Korean films. And finally, her music icon is Patti Smith: &ldquo;I saw her live and was moved by her kindness. I found her autobiography Just Kids very moving (I read quite a lot of autobiographies. I find them reassuring). Patti Smith has a way of taking life as it comes.</small></p>\r\n<br />\r\n<p>Her collaboration with F&ecirc;te Imp&eacute;riale<br /> <small>Jeanne Damas is a frequent visitor to the Leon and Harper store on Boulevard Beaumarchais so Philippe Corbin, the man behind the brand, suggested they try something out together. Rather than a look book to announce the spring-summer 2015 collection, why not ask her to pick out what she likes from the brand&rsquo;s collection and get Quentin de Briey to do a standalone fashion series? &ldquo;I don&rsquo;t particularly want to play at being a super model. I realise this is a serious profession. I like the Leon and Harper style,&rdquo; she explains, &ldquo;their timeless basics, given an twist with their obvious keen eye for detail, faded colours for a much-coveted vintage look, with that slight touch of joy.&rdquo; </small></p>\r\n</div>\r\n<div class="col-xs-12 col-sm-6">\r\n<div class="sub-title">La playlist</div>\r\n<a class="product-image" href="#"> <img class="img-responsive" alt="" src="{{media url=wysiwyg/magazines/articles/josephine-2.jpg}}" /></a></div>\r\n</div>\r\n\r\n</div><div class="next"><a href="#">&nbsp;</a></div>\r\n</div>\r\n</div>', '2015-05-03 09:29:46', '2015-05-11 20:43:35', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(13, 'Gaiya Repossi Essentials', 'one_column', NULL, NULL, 'article3', NULL, '<div class="magazines-articles">\r\n<div class="content">\r\n<div class="prev"><a href="#">&nbsp;</a></div>\r\n<div class="article">\r\n<div class="row">\r\n<div class="col-xs-12 col-sm-6 pull-right"><a class="product-image" href="#"> <img class="img-responsive" alt="" src="{{media url=wysiwyg/magazines/articles/gaiya-reposse-1.jpg}}" /></a>\r\n<div class="follow">\r\n<ul class="soc">\r\n<li><a class="soc-facebook" href="#"><span class="vide">aa</span></a></li>\r\n<li><a class="soc-twitter" href="#"><span class="vide">aa</span></a></li>\r\n<li><a class="soc-pinterest" href="#"><span class="vide">aa</span></a></li>\r\n<li><a class="soc-instagram" href="#"><span class="vide">aa</span></a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class="col-xs-12 col-sm-6 col-spacing">\r\n<div class="sub-category">Daily essentials</div>\r\n<h1 class="title">Gaiya Repossi Essentials</h1>\r\n<p>In the countdown to New York fashion week, we asked our favorite stylists and fashion travelers to share their fashion week packing list. Those essential items in their suitcases that bring comfort and glamor during four weeks of fashion shows.</p>\r\n<ul class="list">\r\n<li>1.Past collection C&eacute;line clogs <span>Because they feel retro.</span></li>\r\n<li>2.C&eacute;line Highlander black sandals <span>Because they feel retro.</span></li>\r\n<li>3.Anthracite Flap bag <span>Because they feel retro.</span></li>\r\n<li>4.Alex Wang pumps <span>Because they feel retro.</span></li>\r\n<li>5.Tommy Hilfiger/ Colette loafers <span>My favourite shoes. I feel like a college boy when I have them on.</span></li>\r\n<li>6.Martin Margiela gray leggings. <span>Because they feel retro.</span></li>\r\n<li>1.Past collection C&eacute;line clogs <span>Because they feel retro.</span></li>\r\n<li>8.Past collection C&eacute;line clogs <span>To never leave my hands naked. To praise and spread my message over the Atlantic.</span></li>\r\n<li>9.Love Note Book / Spiral Jetty <span>To never leave my hands naked. To praise and spread my message over the Atlantic.</span></li>\r\n<li>10.Past collection C&eacute;line clogs <span>Because they feel retro. </span></li>\r\n</ul>\r\n</div>\r\n<div class="col-xs-12 col-sm-6 pull-right"><a class="product-image" href="#"> <img class="img-responsive" alt="" src="{{media url=wysiwyg/magazines/articles/gaiya-reposse-2.jpg}}" /></a>\r\n<div class="follow">\r\n<ul class="soc">\r\n<li><a class="soc-facebook" href="#"><span class="vide">aa</span></a></li>\r\n<li><a class="soc-twitter" href="#"><span class="vide">aa</span></a></li>\r\n<li><a class="soc-pinterest" href="#"><span class="vide">aa</span></a></li>\r\n<li><a class="soc-instagram" href="#"><span class="vide">aa</span></a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class="col-xs-12 col-sm-6"><a class="product-image" href="#"> <img class="img-responsive" alt="" src="{{media url=wysiwyg/magazines/articles/gaiya-reposse-3.jpg}}" /></a>\r\n<div class="follow">\r\n<ul class="soc">\r\n<li><a class="soc-facebook" href="#"><span class="vide">aa</span></a></li>\r\n<li><a class="soc-twitter" href="#"><span class="vide">aa</span></a></li>\r\n<li><a class="soc-pinterest" href="#"><span class="vide">aa</span></a></li>\r\n<li><a class="soc-instagram" href="#"><span class="vide">aa</span></a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class="col-xs-12 col-sm-6 pull-right"><a class="product-image" href="#"> <img class="img-responsive" alt="" src="{{media url=wysiwyg/magazines/articles/gaiya-reposse-4.jpg}}" /></a>\r\n<div class="follow">\r\n<ul class="soc">\r\n<li><a class="soc-facebook" href="#"><span class="vide">aa</span></a></li>\r\n<li><a class="soc-twitter" href="#"><span class="vide">aa</span></a></li>\r\n<li><a class="soc-pinterest" href="#"><span class="vide">aa</span></a></li>\r\n<li><a class="soc-instagram" href="#"><span class="vide">aa</span></a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class="col-xs-12 col-sm-6"><a c